import React from "react";

import "./components/Home.css";
import colors from "../config/colors";
import { CategoryCard, IntroCard } from "./components/Cards";
import Delivery from "../assets/delivery.png";
import Payment from "../assets/payment.png";
import Discount from "../assets/discount.png";
import Return from "../assets/returnPurchase.png";
import Men from "../assets/mensCategory.jpg";
import Girls from "../assets/girlCategory.jpg";
import Women from "../assets/womensCategory.jpg";
import Kids from "../assets/kids.webp";
import Watches from "../assets/watches.jpeg";
import Pets from "../assets/pets.webp";

function Home2() {
  return (
    <div style={{ backgroundColor: "#ECF4EF" }}>
      <div className="fluid-container ">
        <div className="pt-5">
          <h2
            className="title"
            style={{
              textAlign: "center",
            }}
          >
            Our Services
          </h2>
          <div className="underline" />
          <div
            className="cardsContainer mt-5"
            style={{ border: "1px solid black" }}
          >
            <IntroCard
              icon={Delivery}
              title="Free Shipping"
              intro="Free shipping on all US order or order above â‚¹500"
            />
            <IntroCard
              icon={Discount}
              title="Awesome Discount"
              intro="Get Discount upto 40% on women clothings and scandles"
            />
            <IntroCard
              icon={Return}
              title="30 Days Return"
              intro="Simply return it within 30 days for an exchange"
            />
            <IntroCard
              icon={Payment}
              title="Secure Payment"
              intro="100% Secure. We ensure secure payment with RozorPay."
            />
          </div>
        </div>
        <div className="content2 mt-5 col-lg-12">
          <div className="intro2">
            <h1 className="title mt-5" style={{ textAlign: "center" }}>
              Shop By Catagory
            </h1>
            <div className="underline" />
            <div className="cardsContainer mt-3">
              <CategoryCard
                bg={Men}
                title="Mens"
                para="Lorem ipsum dolor sit amet consectetur adipisicing elit."
              />
              <CategoryCard
                bg={Girls}
                title="Girls"
                para="Lorem ipsum dolor sit amet consectetur adipisicing elit."
              />
              <CategoryCard
                bg={Women}
                title="Womens"
                para="Lorem ipsum dolor sit amet consectetur adipisicing elit."
              />
              <CategoryCard
                bg={Kids}
                title="Kids"
                para="Lorem ipsum dolor sit amet consectetur adipisicing elit."
              />
              <CategoryCard
                bg={Watches}
                title="Watches"
                para="Lorem ipsum dolor sit amet consectetur adipisicing elit."
              />
              <CategoryCard
                bg={Pets}
                title="Pets"
                para="Lorem ipsum dolor sit amet consectetur adipisicing elit."
              />
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home2;
